import React from "react";

const WaitList = () => {
  return (
    <>
      <div className="bg-black flex items-center justify-center">
        <button className="relative bg-black text-white text-lg font-semibold py-4 px-20 sm:px-4 sm:py-2 rounded-full border border-gray-700 shadow-md hover:shadow-lg transition">
          Join Waitlist
          <span className="absolute inset-x-0 bg-gradient-to-r from-purple-500 to-pink-500 rounded-full opacity-50 blur-md"></span>
        </button>
      </div>
      <div class="bg-black text-white text-center py-24">
  <h1 class="text-5xl font-bold mb-4">Make AI work for <span class="text-pink-500">your</span> <span class="text-purple-500">brand</span></h1>
  <h2 class="text-3xl font-semibold mb-12">from today.</h2>
  <button class="bg-black text-white font-semibold py-3 px-8 rounded-full hover:bg-gray-800 transition duration-300">Join Waitlist</button>
</div>
     
      
    </>
  );
};

export default WaitList;
